import {useState} from 'react'
function App() {
  let [num, myNum] = useState(0);
  let handler = () => {
    myNum(num + 1);
  };
  return (
    <>
      <h1>{num}</h1>
      <button onClick={handler}>click</button>
    </>
  );
}

export default App;
